import styled from "styled-components";

const FollowButton = styled.button`
  background-color: #2f3640;
  border: 1px solid #dcdde1;
  border-radius: 8px;
  color: #dcdde1;
  width: 100%;
  height: 3em;
`;

export default FollowButton;
